import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useTable, useSortBy } from 'react-table';
import { useHistory } from 'react-router-dom';
import * as XLSX from 'xlsx';
import './TelecomPackView.css';

const TelecomPackView = () => {
  const [telecomPacks, setTelecomPacks] = useState([]);
  const [columns, setColumns] = useState([]);
  const history = useHistory();

  useEffect(() => {
    const fetchTelecomPacks = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/telecom/telecom-packs', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });

        const data = response.data.map(({ createdAt, updatedAt, id, ...rest }) => rest);
        setTelecomPacks(data);

        const headers = Object.keys(data[0] || {});
        const cols = [
          {
            Header: '#',
            accessor: (row, i) => i + 1,
            disableFilters: true,
            disableSortBy: true,
            width: 50,
          },
          ...headers.map((header) => ({
            Header: header.replace(/_/g, ' '),
            accessor: header,
            disableFilters: true,
          })),
        ];

        setColumns(cols);
      } catch (error) {
        console.error('Error fetching Telecom Packs:', error);
        alert('Error fetching Telecom Packs: ' + error.message);
      }
    };

    fetchTelecomPacks();
  }, []);

  const exportToExcel = (data) => {
    const ws = XLSX.utils.json_to_sheet(data);
    const wb = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(wb, ws, "TelecomPacks");
    XLSX.writeFile(wb, "TelecomPacks.xlsx");
  };

  const Table = ({ columns, data }) => {
    const defaultColumn = {
      minWidth: 30,
      width: 150,
      maxWidth: 400,
    };

    const {
      getTableProps,
      getTableBodyProps,
      headerGroups,
      rows,
      prepareRow,
    } = useTable(
      {
        columns,
        data,
        defaultColumn,
      },
      useSortBy
    );

    return (
      <div className="telecom-pack-view-table-container">
        <table {...getTableProps()} className="telecom-pack-view-data-table">
          <thead>
            {headerGroups.map(headerGroup => (
              <tr {...headerGroup.getHeaderGroupProps()}>
                {headerGroup.headers.map(column => (
                  <th {...column.getHeaderProps(column.getSortByToggleProps())}>
                    <div style={{ width: column.width }}>
                      {column.render('Header')}
                      <span>
                        {column.isSorted
                          ? column.isSortedDesc
                            ? ' ðŸ”½'
                            : ' ðŸ”¼'
                          : ''}
                      </span>
                    </div>
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody {...getTableBodyProps()}>
            {rows.map((row, rowIndex) => {
              prepareRow(row);
              return (
                <tr {...row.getRowProps()} className={rowIndex % 2 === 0 ? 'telecom-pack-view-row-even' : 'telecom-pack-view-row-odd'}>
                  {row.cells.map(cell => (
                    <td {...cell.getCellProps()}>{cell.render('Cell')}</td>
                  ))}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div className="telecom-pack-view-container">
      <button className="telecom-pack-view-back-button" onClick={() => history.push('/telecom-pack')}>
        &#x21a9;
      </button>
      <h1 className="telecom-pack-view-title">Afficher Telecom Packs</h1>
      {columns.length > 0 && (
        <Table
          columns={columns}
          data={telecomPacks}
        />
      )}
      <div className="telecom-pack-view-footer">
        <button
          className="telecom-pack-view-export-button"
          onClick={() => exportToExcel(telecomPacks)}
        >
          Export to Excel
        </button>
      </div>
    </div>
  );
};

export default TelecomPackView;
